import React from 'react';
import 'boxicons';

const TextEditor = () => {
    return (
        <div className='containder w-1/2 h-1/2 bg-slate-50 rounded-md p-10'>
            <div className='flex flex-row items-start justify-start flex-wrap gap-5 h-auto'>
                <box-icon name='bold' size='2rem'></box-icon>
                <box-icon name='underline' size='2rem'></box-icon>
                <box-icon name='italic' size='2rem'></box-icon>

                <div className='mr-1' />

                <box-icon name='undo'  size='2rem'></box-icon>
                <box-icon name='redo' size='2rem'></box-icon>
                <box-icon name='unlink' size='2rem'></box-icon>
                <box-icon name='link'  size='2rem'></box-icon>
                
                <div className='mr-5' />

                <box-icon name='list-ul' size='2rem'></box-icon>
                <box-icon name='right-indent'  size='2rem'></box-icon>
                <box-icon name='left-indent'  size='2rem'></box-icon>
                <box-icon name='align-left'  size='2rem'></box-icon>
                <box-icon name='align-middle'  size='2rem'></box-icon>
                <box-icon name='align-right' size='2rem' ></box-icon>
              
        
                <box-icon name='font-size' size='2rem'></box-icon>
                <box-icon name='font-family' size='2rem'></box-icon>

                <div contenteditable="true" className='w-full h-full bg-slate-500'></div>
            </div>
        </div>
    );
};

export default TextEditor;
